import React from "react";
import { connect } from "react-redux";
import {
  setDifficultyEasy,
  setDifficultyMedium,
  setDifficultyHard,
} from "../actions";

const StartPage = ({ props }) => {
  console.log(props);
  return (
    <div className="page">
      <div className="difficulty-title">Difficulty</div>
      <div className="pick-difficulty">
        <p className="difficulty"></p>
        <button
          onClick={() => props.setDifficultyEasy()}
          className="button-difficulty"
        >
          Easy
        </button>
        <button
          onClick={() => props.setDifficultyMedium()}
          className="button-difficulty"
        >
          Medium
        </button>
        <button
          onClick={() => props.setDifficultyHard()}
          className="button-difficulty"
        >
          Hard
        </button>
        <button className="button-difficulty start-button">Start Game</button>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps(), {
  setDifficultyLevel,
})(StartPage);
